                var wwidth = $(window).width();
                var wheight = $(window).height();
                var width, height;
                if (wwidth > wheight) {
                    width = wheight;
                } else {
                    width = wwidth
                }
                //var width = target.width();
                //var width = parseInt(d3.select(".gr-cont").style("width"));
                width = width - margin.left - margin.right;
                console.log(width);
                var gratio = 1;
                height = width * gratio;
                height = height - margin.top * 2;

                $('subsistemas').empty();

                var format = d3.format(',d');
                //var color = d3.scale.category20c();            
                var graph = d3.select('#subsistemas').attr('width', width).attr('height', height);

                var pack = d3.layout.pack()
                    .size([height - margin.left * 2, height - margin.left * 2])
                    .padding([10])
                    .value(function(d) {
                        return d.size
                    });

                var node = graph.datum(subsistemas).selectAll('.node')
                    .data(pack.nodes)
                    .enter().append('g')
                    .attr('class', function(d) {
                        return d.children ? 'node' : 'leaf node';
                    })
                    .attr('transform', function(d) {
                        return 'translate(' + (d.x + margin.left) + ',' + (d.y + margin.top) + ')'
                    });

                node.append('title')
                    .text(function(d) {
                        return d.name + (d.children ? '' : ': ' + format(d.size));
                    });

                node.append('circle')
                    .attr('r', function(d) {
                        return d.r;
                    })
                    .style("fill", function(d) {
                        return d.depth ? '#fff' : '#4B4232';
                    })
                    .style("stroke-width", function(d) {
                        return d.depth ? '0.2em' : '0.5em';
                    })
                    .style("stroke", function(d) {
                        return d.depth ? '#D45C5E' : '#fff';
                    });



                node.filter(function(d) {
                        return !d.children;
                    }).append('text')
                    .attr('class', 'subsis-text')
                    .attr('dy', '.3em')
                    .style('text-anchor', 'middle')
                    .text(function(d) {
                        return d.name.substring(0, d.r);
                    });

                node.filter(function(d) {
                        return d.children;
                    }).append('text')
                    .attr('class', 'sis-text')
                    .attr('dy', '-3.5em')
                    .style('text-anchor', 'middle')
                    .style('fill', '#fff')
                    .text(function(d) {
                        return d.name.substring(0, d.r);
                    });
